import './App.css';
import Navbar from './components/Navbar';
import SignupForm from './components/SignupForm';
import Image from './components/Image';
function App() {
  return (
    <div>
      <Navbar/>
      <div className="side">
        <SignupForm/>
        <Image className='image'/>
      </div>
    </div>
  );
}

export default App;
